// FavoriteList.js
import React from 'react';

const FavoriteList = ({ favoriteAlbums }) => {
  return (
    <ul>
      {favoriteAlbums.map((album) => (
        <li key={album.id}>{album.title}</li>
      ))}
    </ul>
  );
};

export default FavoriteList;
